import React from 'react'

function Header() {
  return (
      <header className="backImage text-white text-center" id="myHeader" >
        <div className="container">
          <div className="backImage-sub mb-4">Welcome To My Blog Page</div>
          <div className="backImage-heading text-uppercase">View Posts!</div>
          <a href="#Posts" class="btn btn-danger btn-lg p-lg-4 text-uppercase fw-bolder">Read More</a>
        </div>
      </header>
  )
}

export default Header
